wikitext.*:
本模板用于把农历日期转换成两个字的文字写法（初一、……、初十、十一、……、二十、廿一、……、廿九、三十）。

==参数==
*format：格式。nl为农历日期，noop为不转换。
*index：日期序号，格式为nl时限定为1到30，noop时无所谓。
*addtail：addtail非空则在转换得到的文字后面加上“日”字。

==例子==
*<code><nowiki>{{User:Hydrofluorina/日|index=4|format=nl}}</nowiki></code> → {{User:Hydrofluorina/日|index=4|format=nl}}
*<code><nowiki>{{User:Hydrofluorina/日|index=10|format=nl}}</nowiki></code> → {{User:Hydrofluorina/日|index=10|format=nl}}
*<code><nowiki>{{User:Hydrofluorina/日|index=21|format=nl|addtail=yes}}</nowiki></code> → {{User:Hydrofluorina/日|index=21|format=nl|addtail=yes}}
*<code><nowiki>{{User:Hydrofluorina/日|index=30|format=nl}}</nowiki></code> → {{User:Hydrofluorina/日|index=30|format=nl}}
*<code><nowiki>{{User:Hydrofluorina/日|index=根本没有这一|format=noop|addtail=yes}}</nowiki></code> → {{User:Hydrofluorina/日|index=根本没有这一|format=noop|addtail=yes}}
